        <div>
              <Router>
    <Switch>
      <Route exact path="/">
        return <HomePage/>
      </Route>
      <Route path="/blog/:slug">
        <BlogPost />
      </Route>
    </Switch>
  </Router>,
  node
        </div>
    )
    function BlogPost() {
        let { slug } = useParams();
        return <div>Now showing post {slug}</div>;
      }
